//import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Pausable.sol";

contract ERC20test is ERC20Pausable {
    address factory;
    address _operator;
    address _pauser;
    constructor(address operator,address pauser,string memory name, string memory symbol,uint8 decimal) public ERC20(name,symbol) {
        _operator = operator;
        _pauser=pauser;
        _setupDecimals(decimal);
        factory=msg.sender;
    }


    modifier onlyFactory(){
        require(msg.sender==factory,"only Factory");
        _;
    }
    modifier onlyOperator(){
        require(msg.sender == _operator,"not allowed");
        _;
    }
    modifier onlyPauser(){
        require(msg.sender == _pauser,"not allowed");
        _;
    }

    function pause() public  onlyPauser{
        _pause();
    }

    function unpause() public  onlyPauser{
        _unpause();
    }

    function changeUser(address new_operator, address new_pauser) public onlyFactory{
        _pauser=new_pauser;
        _operator=new_operator;
    }

    function mint(address account, uint256 amount) public whenNotPaused onlyOperator {
        _mint(account, amount);
    }
    function burn(address account , uint256 amount) public whenNotPaused onlyOperator {
        _burn(account,amount);
    }
}","keccak256":"0x057c05dcc8a9dd9d4dcd4a4454c89a39f3a0ee58384b467330f2ff65cf0dbb47"},"contracts/testToken/Facatory.sol":{"content":"pragma solidity =0.6.6;

import './ERC20Sample.sol';



contract ERC20Factory {
    event ERC20Created(address tokenAddress,string symbol,uint id); 
    address[] public allTokens;
    address public superAdmin;
    //construct
    constructor(address admin) public{
        superAdmin = admin;
    }

    modifier onlySuperAdmin(){
        require(msg.sender == superAdmin,"not allowed");
        _;
    }

    function allTokensLength() external view returns (uint){
        return allTokens.length;
    }

    function createToken(address operator,address pauser,string memory name, string memory symbol,uint8 decimal)
        onlySuperAdmin public returns(address tokenAddress) {
        bytes32 salt = keccak256(abi.encodePacked(name, symbol,decimal));
        ERC20test token = new ERC20test{salt:salt}(operator,pauser,name,symbol,decimal);
        tokenAddress = address(token);
        allTokens.push(tokenAddress);
        emit ERC20Created(tokenAddress,symbol,allTokens.length);

    }
    function changeTokenUser(address token_address,address new_pauser, address new_operator) onlySuperAdmin public {
       ERC20test token= ERC20test(token_address);
       token.changeUser(new_operator,new_pauser);
    }

    function changeSuperAdmin(address new_admin) onlySuperAdmin public {
        superAdmin=new_admin;
    }

